function obfuscate(input) {
  let result = '';
  const r = /[a-zA-Z]+/g;
  for (let i = 0; i < input.length; i++) {
    const code = input.charAt(i);
    if (r.test(code)) {
      result += `a${code.charCodeAt(0)}` + `\n`;
    } else {
      result += `d${code}` + `\n`;
    }
  }
  return result.substring(0, result.length - 1);
}
